    Then               Census Bureau added landmark features to MTDB on an as-needed
    basis and made no attempt to ensure that all instances of a particular feature weren
                  included. The presence or absence of a landmark such as a hospital
    or prison does not mean that the living quarters associated with that landmark weren
                  geocoded to that census tabulation block or excluded from the census
    enumeration. The Area Landmark Shapefile does not include military installations
